package com.aio.portable.park.unit.tutorial;

import com.aio.portable.park.common.UserInfoEntity;
import com.aio.portable.swiss.suite.bean.BeanSugar;
import org.junit.Test;
import org.springframework.boot.test.context.TestComponent;
import org.springframework.cglib.proxy.Callback;
import org.springframework.cglib.proxy.Enhancer;
import org.springframework.cglib.proxy.MethodInterceptor;
import org.springframework.cglib.proxy.MethodProxy;

import java.lang.reflect.Method;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

@TestComponent
public class OOM {
    // -XX:MaxMetaspaceSize=10M
    public static final void oomMetaspace1() {
        int i = 1;
        while (i == 1) {
            Enhancer enhancer = new Enhancer();
            enhancer.setSuperclass(Callback.class);
            enhancer.setUseCache(false);
            enhancer.setCallback(new MethodInterceptor() {
                public Object intercept(Object o, Method method, Object[] objects, MethodProxy methodProxy) throws Throwable {
                    return methodProxy.invokeSuper(o, objects);
                }
            });
            Callback callback = (Callback) enhancer.create();
        }
    }

    @Test
    // -XX:MaxMetaspaceSize=10M
    public static final void oomMetaspace2() {
        String text = "";
        int i = 1;
        while (i == 1) {
            text = (text + text + text + text + text + text + text + text + text + text + text + text + text + text + text + text + text + text + text).intern();
        }
    }

    @Test
    // -Xms50M -Xmx50M
    public static final void oomHeapSpace() {
        int i = 1;
        List<OOM> list = new ArrayList<>();
        while (i == 1) {
            OOM oom = new OOM();
            list.add(oom);
            try {
                Thread.sleep(10);
            } catch (InterruptedException e) {
                e.printStackTrace();
            }
        }
    }

    @Test
    // -Xms50M -Xmx50M
    // VMoptions: -Xlog:gc*:file=/log.txt -Xloggc:/log2.txt -XX:+PrintGCDetails -XX:+HeapDumpOnOutOfMemoryError -XX:HeapDumpPath=/gc.txt
    public void oomHeapSpace1() {
        List<String> list = new ArrayList<>(999999);
        for (int i = 0; i < 999999; i++) {
            list.add(String.valueOf(i).intern());
        }
    }

    @Test
    public void oomHeapSpace2() {
        UserInfoEntity userInfoEntity = new UserInfoEntity();
        userInfoEntity.setId(1);
        userInfoEntity.setName("name");
        userInfoEntity.setNextId(2);
        int i = 1;
        Map<Integer, Object> map = new HashMap<>();
        while (i != 0)
            map.put(i++, BeanSugar.Cloneable.deepCloneByCglib(userInfoEntity));
    }

    static long stack = 0;

    @Test
    // -Xss1m
    public static final void stackoverflow() {
//        Unsafe.allocateMemory(1024*1024*1024*1024*1024);



        try {
            stack++;
            stackoverflow();
        } catch (Error e) {
            e.printStackTrace();
            System.out.println(stack);
        }
    }

    public static final void ygc() {
        int i = 1;
        while (i == 1) {
            OOM oom = new OOM();
        }
    }


    public void fullCpu() {
        int i = 10;
        while (true) {
            i++;
            i--;
        }
    }

    @Test
    public void stringConstant() {

    }

    @Test
    public void runtimeConstant() {
        ArrayList<Integer> list = new ArrayList<>();
        while (true) {
            list.add("abcdefg".length());
        }
    }
}
